SPARCO(スパルコ)ネックサポート Professional(プロフェッショナル)カート専用タイプ/リアサポート付は、スタンダードタイプのネックサポートにアナトミカル(解剖学的)なリアサポートを採用したネックサポートです。サポート本体のパッドはヘルメットを支える後部に硬い素材を、顎の当たる前部には柔らかい素材を採用していますので、ヘルメットの重量感を軽減しながら顎の部分に負担を掛けない安全性と使用感をバランスさせたネックサポートです。 <br><br>●カラー：ブルー ●サイズ：ジュニア向け<br><br>※HANSとの併用は出来ませんのでご注意ください。※実際の製品カラーにつきましては、掲載写真と多少異なる場合がございます。また製品改良のため、予告なく仕様変更となる場合がございますので、予めご了承ください。 <br><br>対応車種： 汎用品 <br><br>車検対応品<br><br>グッズ・アクセサリー/グッズアクセサリーその他<tr><td colspan="2">
